import React from "react";

export default function Checking() {
  let details = [
    {
      ExampleOfTreatmentAvailable: [
        "Pankaj","Preet","Yaashi"
        // {
        //   treatment: "Cancer Curative Treatment",
        // },
        // {
        //   treatment: "Sar Dard",
        // },
        // {
        //   treatment: "Stomatch Pain",
        // },
        // {
        //   treatment: "Brain",
        // },
      ],
    },
  ];

  return (
    <div>
      {details.map((x,i)=>{
        return <p key={i}>{x}</p>
      })}
    </div>
  );
}
